import React, {useState} from "react";

function Navbar(props) {
	const [viewNav, setViewNav] = useState(true)
    const [viewClasses, setViewClasses] = useState(true)
	const [viewMusic, setViewMusic] = useState(true)
	const [viewBookings, setViewBookings] = useState(true)



	return (
		<>
			{viewNav ?? (
				<div className="navbar">
					<ul className="navbar-list">
						<li onClick={viewClasses} className="classes-link menu-link">
							Available Classes
						</li>
						<li onClick={viewMusic} className="music-link menu-link">
							My Music
						</li>
						<li onClick={viewBookings} className="bookings-link menu-link">
							Book a Private Event
						</li>
					</ul>
				</div>
			)}

			{viewClasses ?? <div className="classes">Classes</div>}

			{viewMusic ?? <div className="music">Music</div>}

			{viewBookings ?? <div className="bookings">Bookings</div>}

			<div>nav</div>
		</>
	);
}

export default Navbar;
